import { useState } from "react";
import { TodoLists } from "./Pages/TodoLists";
import { GlobalStyle } from "./Style/GlobalStyle";
import { Route, Routes } from "react-router-dom";
import { AddPage } from "./Pages/AddPage";

function App() {
  const [locate, setLocate] = useState("main");
  console.log(locate);
  return (
    <>
      <GlobalStyle />
      <div className="App">
        <Routes>
          <Route
            exact
            path="/"
            element={<TodoLists locate={locate} setLocate={setLocate} />}
          ></Route>
          <Route
            path="/add"
            element={<AddPage locate={locate} setLocate={setLocate} />}
          ></Route>
        </Routes>
      </div>
    </>
  );
}

export default App;
